import React, { Component } from "react";
import styled from 'styled-components';

const Wrapper = styled.section`
    position: fixed;
    width: 100%;
    height: 100%;
    top: 0;
    left: 0;
    margin: auto;
    background: rgba(0,0,0,0.5);
`;
const ModalCard = styled.div`
    background: #fff;
    border-radius: 10px;
`;

class Modal extends Component {
    render() {
        return (
            <Wrapper>
                <ModalCard>

                </ModalCard>
            </Wrapper>
        )
    }
}

export default Modal
